// import {Link} from 'react-router-dom'

const ShopItem = ({match, EntriesDetails}) => {

    const {items} = EntriesDetails;
    
    return (
        <div>
            {items.map((item, i) => {
                return <p></p>
            })}
        </div>
    )
}

